(20, 1, '2018-02-26 10:02:00', '2018-02-26 10:02:00', '<div>The Pinewood Lake</div>\n<h1>Restaurant</h1>\n<ul>\n        <li>\n\n        \n<h2>Breakfast</h2>\n\n<p>6 am - 11 am</p>\n\n\n\n    </li>\n        <li>\n\n        \n<h2>Lunch</h2>\n\n<p>12 am - 3 pm</p>\n\n\n\n    </li>\n        <li>\n\n        \n<h2>Dinner</h2>\n\n<p>6 pm -  11 pm</p>\n\n\n\n    </li>\n    </ul>\n<img src="wp-content/uploads/restaurant-hero.jpg" alt="">\n<h2>Our Menu</h2>\n<h3>Breakfast</h3>\n<ul>\n        <li>\n\n        <h3>Small Continental Breakfast</h3>\n\n<p>7.80 €</p>\n\n<div>Two rolls, 1 free-range egg, ham & cheese, homemade jam, butter</div>\n\n    </li>\n        <li>\n\n        <h3>Full Continental Breakfast</h3>\n\n<p>12.50 €</p>\n\n<div>Assortment of rolls, 2 free-range eggs (fried, scrambled or poached), salami, ham & cheese, homemade jam, muesli & yoghurt, butter</div>\n\n    </li>\n        <li>\n\n        <h3>French Breakfast</h3>\n\n<p>6.70 €</p>\n\n<div>2 croissants, homemade jam, hazelnut spread, butter, café au lait</div>\n\n    </li>\n    </ul>\n<ul>\n        <li>\n\n        <h3>Eggs three ways on Toast</h3>\n\n<p>8.90 €</p>\n\n<div>3 free-range eggs – fried, poched or scrambled with bacon and onions</div>\n\n    </li>\n        <li>\n\n        <h3>Full English Roll</h3>\n\n<p>10.80 €</p>\n\n<div>Puff pastry filled with sausage, bacon, free-range egg, grilled mushrooms & tomatoes and JP sauce</div>\n\n    </li>\n        <li>\n\n        <h3>Eggs Benedict</h3>\n\n<p>9.90 €</p>\n\n<div>Toasted muffin, 2 poached free-range eggs, bacon, sauce hollandaise</div>\n\n    </li>\n    </ul>\n<h3>Lunch</h3>\n<h4>Starters</h4>\n<ul>\n        <li>\n\n        <h3>Catch of the Day Sea Scallops</h3>\n\n<p>9.80 €</p>\n\n<div>Sautéed with with garlic and brown lime butter</div>\n\n    </li>\n        <li>\n\n        <h3>Mexican Corn Salad</h3>\n\n<p>7.50 €</p>\n\n<div>Organic corn, pepper, onions, orange filets and vinaigrette</div>\n\n    </li>\n    </ul>\n<h4>Mains</h4>\n<ul>\n        <li>\n\n        <h3>Organic Pork Medallions</h3>\n\n<p>14.50 €</p>\n\n<div>Balsamic-honey reduction, oven baked potato and watercress salad</div>\n\n    </li>\n        <li>\n\n        <h3>Grilled Tuna steak</h3>\n\n<p>17.90 €</p>\n\n<div>From sustainable Adria fishery, with risotto, green asparagus and Teriyaki sauce</div>\n\n    </li>\n        <li>\n\n        <h3>Stuffed Aubergine (Egg Plant)</h3>\n\n<p>11.50 €</p>\n\n<div>Quinoa and parsley, served with pomegranate seeds and coconut yoghurt</div>\n\n    </li>\n    </ul>\n<img src="wp-content/uploads/home-restaurant.png" alt="">\n<h3>Dinner</h3>\n<h4>Starters</h4>\n<ul>\n        <li>\n\n        <h3>Catch of the day prawns</h3>\n\n<p>10.90 €</p>\n\n<div>Roasted with garlic, lime and coriander</div>\n\n    </li>\n        <li>\n\n        <h3>Seasonal salad (vegan)</h3>\n\n<p>7.50 €</p>\n\n<div>The best vegetables of the seasion, handpicked by our head chef – always with a twist. Please ask your server for more information!</div>\n\n    </li>\n    </ul>\n<h4>Mains</h4>\n<ul>\n        <li>\n\n        <h3>Fried Monkfish</h3>\n\n<p>22.10 €</p>\n\n<div>With caramelized shallots, pea purée</div>\n\n    </li>\n        <li>\n\n        <h3>Oven baked chicken</h3>\n\n<p>15.70 €</p>\n\n<div>With scorched corn, garlic mashed potatoes</div>\n\n    </li>\n        <li>\n\n        <h3>Chanterelle Risotto</h3>\n\n<p>13.50 €</p>\n\n<div>With young green asparagus and parmesan crisps</div>\n\n    </li>\n    </ul>\n<h4>Dessert</h4>\n<ul>\n        <li>\n\n        <h3>Cardamom Crème brûlée</h3>\n\n<p>8.90 €</p>\n\n<div>With sirup and drunken prunes</div>\n\n    </li>\n        <li>\n\n        <h3>Organic cheese platter</h3>\n\n<p>10.80 €</p>\n\n<div>Assortment of cheese (ask server), fruit, honey fig mustard</div>\n\n    </li>\n        <li>\n\n        <h3>Chocolate lava cake</h3>\n\n<p>7.80 €</p>\n\n<div>Hot and delicious with chilled mango mascarpone</div>\n\n    </li>\n        <li>\n\n        <h3>Panna Cotta</h3>\n\n<p>6.90 €</p>\n\n<div>With a fresh basil-citrus note on a strawberry mirror</div>\n\n    </li>\n    </ul>\n<hr>\n<img src="wp-content/uploads/restaurant-quote.jpg" alt="">\n<blockquote>\n\n    Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo. \n        <footer>\n\n        \n                <cite>Nicolas Gellar, Head Chef</cite>\n        \n    </footer>\n    \n</blockquote>\n<div>\n\n    \n        <h2>Special Menus</h2>\n    \n    \n        <div>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</div>\n    \n    \n</div>\n<h3>Seasonal Course Menu March 2018</h3>\n<ul>\n        <li>\n\n        \n<h4>For Carnivores</h4>\n\n<p>Lorem ipsum dolor sit amet justo. Sollicitudin aliquam condimentum. Voluptatem suspendisse.</p>\n\n<div>78.50 €</div>\n\n\n    </li>\n        <li>\n\n        \n<h4>Veggie Friendly</h4>\n\n<p>Lorem ipsum dolor sit amet justo. Sollicitudin aliquam condimentum. Voluptatem suspendisse.</p>\n\n<div>67.20 €</div>\n\n\n    </li>\n        <li>\n\n        \n<h4>Seafood Menu</h4>\n\n<p>Lorem ipsum dolor sit amet justo. Sollicitudin aliquam condimentum. Voluptatem suspendisse.</p>\n\n<div>96.50 €</div>\n\n\n    </li>\n    </ul>\n<h2>Best Quality</h2>\n<div>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud. </div>\n<img src="wp-content/uploads/restaurant-quality-sustainable.jpg" alt="">\n<div>\n\n    \n        <h3>Sustainable Sources</h3>\n    \n    \n        <div><p>Lorem ipsum dolor sit amet justo. Sollicitudin aliquam condimentum. Voluptatem suspendisse elementum. Odio feugiat eveniet. Ornare nibh in scelerisque nec amet fermentum dis cras sed enim porta.</p>\n\n<p>Lorem ipsum dolor sit amet justo. Sollicitudin aliquam condiment