ive Music & Dancing Evenings</h3>\n\n\n<div>Live Music & Dancing Evenings</div>\n\n\n    </li>\n        <li>\n\n        <img src="wp-content/uploads/about-activities-08.jpg" alt="">\n\n<h3>Events for Kids</h3>\n\n\n<div>Events for Kids</div>\n\n\n    </li>\n    </ul>\n<div>\n\n    \n        <h3>Surrounding Area</h3>\n    \n    \n        <div><p>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diamno numy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet.</p>\n\n<p>At vero eos et accusam et justo duo dolores et ea rebum clita kasd gubergren no sea takimata sanctus est Lorem ipsum dolor.</p></div>\n    \n    \n</div>\n<img src="wp-content/uploads/about-impression-01.jpg" alt="">\n<img src="wp-content/uploads/about-impression-02.jpg" alt="">\n<img src="wp-content/uploads/about-impression-03.jpg" alt="">\n<img src="wp-content/uploads/about-impression-04.jpg" alt="">\n<img src="wp-content/uploads/about-impression-05.jpg" alt="">\n<img src="wp-content/uploads/about-impression-06.jpg" alt="">\n<div>\n\n    \n        <h3>SPORTS AND RECREATIONAL OPPORTUNITIES</h3>\n    \n    \n        <div>Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos et accusam et justo duo dolores et ea rebum.</div>\n    \n    \n</div>\n<div>Watersports<br>\nSwimming<br>\nKayaking<br>\nFishing<br>\nHiking<br>\nExploring<br>\nClimbing<br>\nCycling</div>\n<div>\n\n        <img src="wp-content/uploads/about-james.jpg" alt="">\n    \n        <h2>James Arthur McMullen</h2>\n    \n        <p>Pinewood Lake Owner and Manager</p>\n    \n        <div>"Lorem ipsum dolor sit amet, consetetur sadipscing elitr, sed diam nonumy eirmod tempor invidunt ut labore et dolore magna aliquyam erat, sed diam voluptua. At vero eos