                    $sql   = str_replace(array("@@TABLE_PREFIX@@", "@@SITE_URL@@", "@@ADMIN_EMAIL@@"),array($wpdb->prefix, get_option("siteurl"), get_option("admin_email")),$sql);
                    $lines = explode("\n", $sql);
                    $query = "";

                    foreach ($lines as $line) {
                        $line = trim($line);
                        if (strlen($line)==0) continue;
                        if (substr($line,-1)==";") {
                            $query.=" ".$line;
                            $wpdb->query($query);
                            $query = "";
                        } else {
                            $query.=" ".$line;
                        }
                    }

                    // create media thumbnails
                    $query_args = array(
                        'post_type' => 'attachment',
                        'post_mime_type' => 'image',
                        'post_status' => 'any',
                        'posts_per_page' => -1,
                        'fields' => 'ids'
                    );

                    $images = new WP_Query($query_args);

                    if ($images->post_count > 0) {

                        foreach ($images->posts as $number => $id) {

                            $filepath = get_attached_file($id);
                            $metadata = wp_generate_attachment_metadata($id, $filepath);
                            wp_update_attachment_metadata($id, $metadata);

                        }

                    }

                    $wp_rewrite->flush_rules();
                    wp_cache_flush();

                    unlink(__FILE__);
